import React from "react";

const newblock = {
    backgroundColor: "red",
    borderRadius: "50px",
    display: "block",
    width: "600px",
    height: "400px",
    marginLeft: "500px",
    marginTop: "50px",
    alignContent: "center"
}

export default class ReportDisplay extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            reports: this.props.reportList,
        };
        console.log("Report Display State")
        console.log(this.state)
    }

    render() {
        var chunkedPartsArray = [['A','B','C'], ['D','E','F'], ['G']]
        return(
            <div style={newblock}>
                <table>
                    <tbody>
                    {this.state.reports.map((item,i)=>
                        <tr id={i}>
                            <td style={{textAlign:'center'}}>{item.name}</td>
                            <td style={{textAlign:'center'}}>{item.full_name}</td>
                        </tr>
                    )}
                    </tbody>
                </table>
            </div>
        )
    }
}
